import React, { Component } from 'react';
import '../App.css';
import log4js from 'log4js';
import axios from 'axios';


class PageCopy extends Component {
    
    constructor(){
        super();
        this.state = {
            urlToClone : ''
        }
    }

    componentDidMount () {
        debugger

        let url = this.props.location.pathname + this.props.location.search
        
       

        //logica para clonar la pagina
        let urlAClonar = 'https:/' + url

        this.setState({
            urlToClone : urlAClonar
        })

        const logger = log4js.getLogger();
        console.log('El url a consumir por axios es: ' + urlAClonar)
        logger.info('El url a consumir por axios es: ' + urlAClonar);

        axios.get(urlAClonar)
        .then(function (response) {
            console.log(response);
        })
        .catch(function (error) {
            console.log(error);
        });
    }

  render() {
    return (
        <div className="container">
            <form id="create-course-form" className="card-body">
                {this.state.urlToClone}
                
            </form>
        </div>
    );
  }
}

export default PageCopy;
